  03> GARDINER, Allayne Diana
  b 30.09.1996
  03>'GARDINER, Evelyn Ruth
  b 11.05.1899 d 11.12.1899
  Evelyn b. at Marton and d, at Napier.
  04> GARDINER, Edith Mildred
  b 21.04.1900 d 01.03.1983
  Edith b. at Napier, d. at Auckland and bd. at Napier.
  Edith was a registered nurse and midwife and had her own maternity hospital in Hastings in the late 1930's.
  She lived in Napier until 1974 when she moved to Howick, Auckland. She was decorated with the Order of St
  John for her work with the St John Ambulance.
  05> GARDINER, Sydney Reade m on 19.01.1933 to BAKER, Christine Helen
  b 21.04.1900 d 25.07.1968
  b 09.05.1909 d 11.09.1973
  Sydney b. at Napier. Christine d. at Howick and bd, at Napier.
  Sydney worked as a clerk (1920-23) with the Sydney stock and sharebroking firm of Joseph
  Palmer and Sons before entering Jesus College, Cambridge. On gaining his MA he attended
  Cuddesdon Theological College, Oxford, was made a deacon in 1927 and ordained a priest in
  the Diocese of Worcester in 1928. He served as a curate in Kidderminster before returning to
  New Zealand to become curate at St John's Cathedral, Napier. He served in parishes at
  Waverley, St Augustines in Napier, Dannevirke and Te Puke and retired to Napier. He was a Canon in the
  Diocese of Waiapu (1948-61) and served for 20 years as a member of the Diocesan Standing Committee. For
  eight years he was Chairman of the Dannevirke High School Board of Governors, and became a Vice-president
  of the New Zealand Secondary School Boards Association.
  01> GARDINER, Anthony Reade m on 16.12.1972 to ABERNETHY, Nancy
  b 11.05.1935
  b 01.07.1930
  Anthony b. at Waverley and m. at St George's Anglican Church, Whakatane. Nancy, d/o William Frank Angus
  Rocke and Myrtle Augusta Andrews. Nancy has children David (b. 15.06.1955), James (b. 04.04.1957),
  Peter (b. 21.04.1959), Stephen (b. 01.09.1960), Andrew (b. 24.03.1963), and Jonathan (b. 28.08.1966)
  from a former marriage, all with surname Abernethy. Address: The Vicarage, Down St Mary, Crediton,
  Devon EX17 6EF, England.
  Anthony graduated BA from Canterbury University, trained at Cuddesdon Theological College, Oxford and
  was ordained at Newcastle on Tyne. He served in Gosforth (UK), Te Karaka, Edgecumbe-Kawerau, Eltham,
  Trentham and Waipukurau, and at Nelson Cathedral as Chaplain. He is now Vicar at four parishes in
  mid-Devon, UK (Down St Mary with Knowle, Clannaborough, Stockleigh Pomeroy and Newbuildings).
  Nancy trained as a primary school teacher. Her interests include patchwork and quilting.
  01> GARDINER, Rachel Elizabeth
  b 19.10.1975
  Rachel graduated BA (Hons) in Psychology from the University of Otago and is now studying Clinical
  Psychology at Victoria University and completing a PhD at the same time. Email:
  rachel.gardiner@vuw.ac.nz.
